When calling or invoking a function, you place parentheses (if this is necessary) right after the function name. Here's an example: 
```javascript 
function greet(name) { 
  console.log("Hello, " + name); 
} 
greet("Alice"); // logs: Hello, Alice 
``` 
In this example, we have a function called `greet` that expects one parameter `name`. To invoke this function and pass it an argument "Alice", we simply write `greet("Alice")`. The console will log the string "Hello, Alice". 

Keep in mind that some functions do not expect any parameters, so when calling such functions, you won't include any arguments inside those parentheses: 
```javascript 
function sayHi() { 
  console.log("Hi!"); 
} 
sayHi(); // logs: Hi! 
```

