The task here is to understand how to create a balanced training set when there is a very rare category that does not have many examples in the initial corpus. To create balanced synthetic data we can follow three main ways:  

1) **Data Augmentation**: Data augmentation is a technique used to artificially increase the number of samples by generating additional variations starting from the existing ones. Depending on the nature of the input features it can consist into different operations such as cropping, padding, flipping, rotating, etc.. 

For instance given a text classification task in case all examples belonging to the category B were represented with the token (or n-gram) sequence `“hello, this is category B”`, we can artifically increase their quantity with slight modifications such as introducing punctuation changes, swap ping letters or modifying the sequence length e.g., `"hello this is category B" -> "[hello] this is Category[B];"`. 

The main advantage resides in maintaining high fidelity compared to other solutions while being computationally efficient since it relies just modifying what’s already present. The main drawback consists in limiting generalization capability since similar modifications applied may introduce noise into the learning process due to overfitting risks. 

2) **Transfer Learning/Meta Learning**: In some cases, pre-training models with related tasks or datasets can help improve generalization capabilities on downstream problems even without having enough amount of instances in the minority category. A typical application involves fine tuning pre-trained embeddings from Word2Vec, GloVe or ELMO atop them on top of specific architectures (i.e., CNN, LSTM). Alternative methods involve multitasking through

